import React, { useState } from 'react';


function Button(props) {
    const [count, setCount] = useState(0);

    return (
      <button className={"button " + props.styleclass} onClick={() => setCount(count + 1)}>{props.label + " " + count}</button>
    );
  }

  export default Button;
